import { useEffect } from "react";
import { useSelector } from "react-redux"

export default function Favorites() {
    const myFavorites = useSelector((state) => state.myFavorites);
    useEffect(()=>{},[myFavorites]);
    return (
        <div>  
            <div>
                <option></option>
            </div>
            {myFavorites.map((fav) =>
                <div key={fav.id}>
                    <span>{fav.name}</span>
                    <img src={fav.image} alt={fav.name} />
                </div>
            )}
        </div>
    )
}
